export default function Validate(userData, setErrors, errors, property) {
    if(!userData[property]) {
        setErrors({...errors, [property]: `${property} sin completar`});
    }

    else {
        if (property === 'username') {
            if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(userData.username) && userData.username.length < 35) {
                setErrors({...errors, [property]: '', boolean: true});
            }
            else setErrors({...errors, [property]: 'username inv치lido', boolean: false});
        }

        else if (property === 'password') {
            console.log(property)
            const obj = {
                length: /(?=.{7,40}$)/,
                digit: /(?=.*[0-9])/,
            };
            if (obj.length.test(property) && obj.digit.test(property)) setErrors({...errors, [property]: '', boolean: true});
            else setErrors({...errors, [property]: 'username inv치lido', boolean: false});
        }
    }
}
